          "distinct": true,
          "id": "96995dd4d00fdd3e241bcf5fdd76b5ad85476bfd",
          "message": "NormalizerNFKC unify_alphabet_diacritical_mark: remove diacritical mark for `a` (#1859)\n\nGitHub: ref GH-1755\r\n\r\nThis PR enhances the NormalizerNFKC by introducing functionality to the\r\n`unify_alphabet_diacritical_mark` option,\r\nspecifically aimed at stripping diacritical marks from characters\r\nrelated to the letter `a`.\r\n\r\nIt ensures that any character with diacritical marks falling under the\r\nCombining Diacritical Marks Unicode block is normalized to `a`.\r\n\r\nref: https://www.unicode.org/charts/PDF/U0300.pdf\r\n\r\n## For reviewers\r\n\r\nThe following code can generate a mapping between Unicode and UTF-8.\r\nPlease feel free to use it if you find it helpful. Thanks @kou !!!\r\n\r\n```ruby\r\n#!/usr/bin/env ruby\r\n\r\ndef have_diactritical_combining_character?(character)\r\n  code_points = character.unicode_normalize(:nfd).codepoints\r\n  code_points.any? do |code_point|\r\n    (0x0300..0x036f).cover?(code_point)\r\n  end\r\nend\r\n\r\ndef base_character(character)\r\n  character.unicode_normalize(:nfd).chars.first\r\nend\r\n\r\ndef base_character_is_lower_alphabet?(character)\r\n  base_code_point = base_character(character).codepoints.first\r\n  ((\"a\".codepoints.first)..(\"z\".codepoints.first)).cover?(base_code_point)\r\nend\r\n\r\n(0x0000..0xffff).each do |code_point|\r\n  begin\r\n    character = code_point.chr(\"UTF-8\")\r\n  rescue RangeError\r\n    next\r\n  end\r\n  next unless have_diactritical_combining_character?(character)\r\n  next unless base_character_is_lower_alphabet?(character)\r\n  next unless base_character(character) == \"a\"\r\n  pp [\"U+%04x\" % code_point, character, character.bytes.collect {|b| \"%#02x\" % b}]\r\nend\r\n```\r\n```console\r\n$ ruby convert-unicode-to-utf8.rb\r\n[\"U+00e0\", \"\", [\"0xc3\", \"0xa0\"]]\r\n[\"U+00e1\", \"\", [\"0xc3\", \"0xa1\"]]\r\n[\"U+00e2\", \"\", [\"0xc3\", \"0xa2\"]]\r\n[\"U+00e3\", \"\", [\"0xc3\", \"0xa3\"]]\r\n[\"U+00e4\", \"\", [\"0xc3\", \"0xa4\"]]\r\n[\"U+00e5\", \"\", [\"0xc3\", \"0xa5\"]]\r\n[\"U+0101\", \"\", [\"0xc4\", \"0x81\"]]\r\n[\"U+0103\", \"\", [\"0xc4\", \"0x83\"]]\r\n[\"U+0105\", \"\", [\"0xc4\", \"0x85\"]]\r\n[\"U+01ce\", \"\", [\"0xc7\", \"0x8e\"]]\r\n[\"U+01df\", \"\", [\"0xc7\", \"0x9f\"]]\r\n[\"U+01e1\", \"\", [\"0xc7\", \"0xa1\"]]\r\n[\"U+01fb\", \"\", [\"0xc7\", \"0xbb\"]]\r\n[\"U+0201\", \"\", [\"0xc8\", \"0x81\"]]\r\n[\"U+0203\", \"\", [\"0xc8\", \"0x83\"]]\r\n[\"U+0227\", \"\", [\"0xc8\", \"0xa7\"]]\r\n[\"U+1e01\", \"\", [\"0xe1\", \"0xb8\", \"0x81\"]]\r\n[\"U+1ea1\", \"\", [\"0xe1\", \"0xba\", \"0xa1\"]]\r\n[\"U+1ea3\", \"\", [\"0xe1\", \"0xba\", \"0xa3\"]]\r\n[\"U+1ea5\", \"\", [\"0xe1\", \"0xba\", \"0xa5\"]]\r\n[\"U+1ea7\", \"\", [\"0xe1\", \"0xba\", \"0xa7\"]]\r\n[\"U+1ea9\", \"\", [\"0xe1\", \"0xba\", \"0xa9\"]]\r\n[\"U+1eab\", \"\", [\"0xe1\", \"0xba\", \"0xab\"]]\r\n[\"U+1ead\", \"\", [\"0xe1\", \"0xba\", \"0xad\"]]\r\n[\"U+1eaf\", \"\", [\"0xe1\", \"0xba\", \"0xaf\"]]\r\n[\"U+1eb1\", \"\", [\"0xe1\", \"0xba\", \"0xb1\"]]\r\n[\"U+1eb3\", \"\", [\"0xe1\", \"0xba\", \"0xb3\"]]\r\n[\"U+1eb5\", \"\", [\"0xe1\", \"0xba\", \"0xb5\"]]\r\n[\"U+1eb7\", \"\", [\"0xe1\", \"0xba\", \"0xb7\"]]\r\n```",
