          "id": "de65ae649af91b6439360915f29cda5f39d9daf6",
          "message": "NormalizerNFKC unify_alphabet_diacritical_mark: remove diacritical mark for `i` (#1910)\n\nGitHub: GH-1755\r\n\r\nImplementation of grn_nfkc_normalize_unify_alphabet_diacritical_mark().\r\nCommit to normalize to `i`.\r\n\r\nNote that \"U+0130 LATIN CAPITAL LETTER I WITH DOT ABOVE\" isn't\r\nnormalized correctly.\r\nIt should be normalized to \"U+0069 LATIN SMALL LETTER I\" but it's\r\nnormalized to \"U+0069 LATIN SMALL LETTER I\" and \"U+0307 COMBINING DOT\r\nABOVE\". It will not be fixed in `NormalizerNFKC150` or older to keep\r\nbackward compatibility. It should be fixed in `NormalizerNFKC160` or\r\nlater. See also: #1939\r\n\r\nTarget characters:\r\n\r\n```\r\n% ./tools/generate-alphabet-diacritical-mark.rb i\r\n## Generate mapping about Unicode and UTF-8\r\n[\"U+00ec\", \"\", [\"0xc3\", \"0xac\"]]\r\n[\"U+00ed\", \"\", [\"0xc3\", \"0xad\"]]\r\n[\"U+00ee\", \"\", [\"0xc3\", \"0xae\"]]\r\n[\"U+00ef\", \"\", [\"0xc3\", \"0xaf\"]]\r\n[\"U+0129\", \"\", [\"0xc4\", \"0xa9\"]]\r\n[\"U+012b\", \"\", [\"0xc4\", \"0xab\"]]\r\n[\"U+012d\", \"\", [\"0xc4\", \"0xad\"]]\r\n[\"U+012f\", \"\", [\"0xc4\", \"0xaf\"]]\r\n[\"U+01d0\", \"\", [\"0xc7\", \"0x90\"]]\r\n[\"U+0209\", \"\", [\"0xc8\", \"0x89\"]]\r\n[\"U+020b\", \"\", [\"0xc8\", \"0x8b\"]]\r\n[\"U+1e2d\", \"\", [\"0xe1\", \"0xb8\", \"0xad\"]]\r\n[\"U+1e2f\", \"\", [\"0xe1\", \"0xb8\", \"0xaf\"]]\r\n[\"U+1ec9\", \"\", [\"0xe1\", \"0xbb\", \"0x89\"]]\r\n[\"U+1ecb\", \"\", [\"0xe1\", \"0xbb\", \"0x8b\"]]\r\n--------------------------------------------------\r\n## Generate target characters\r\n\r\n```\r\n\r\n---------\r\n\r\nCo-authored-by: Sutou Kouhei <kou@clear-code.com>",
